import React from "react";
import "./App.css";
import resumePdf from "./images/Manami_Ueda_Resume_website.pdf";

function Resume() {
  return (
    <div id="Resume">
      <h1>Resume</h1>
      <div class="Bar"></div>
      <div className="Resume-link">
        <a
          className="image3"
          href={resumePdf}
          download
          target="_blank"
          className="Try-demo"
          type="button"
        >
          View Resume
        </a>
        <a
          href="https://github.com/manamiueda1/stackathon"
          target="_blank"
          className="View-code"
          type="button"
        >
          Download Resume
        </a>
      </div>
    </div>
  );
}

export default Resume;
